import { render } from '@testing-library/react';
import React, {Component} from 'react';

class Hello extends Component {
    render() {
        return(
            <div>
                <h1> Hello World </h1>;
                <h2>Hi Ganesh </h2>;
            </div>
        )
    }
}

export default Hello;
